import React, { Component } from 'react';
import vegetableData from '../data/vegetableData.json';
import { searchVegetable, filterHandler, addToCartHandler, removeFromCartHandler } from '../helperFunction/stateChangeFunction';
import {FILTER_TYPES, CART_STATUS} from '../data/constData';
import Navbar from './components/billingPage/organisms/header/Navbar';
import SubHeaderCategories from './components/billingPage/molecules/header/SubHeaderCategories';
import OurServices from './components/billingPage/molecules/service/OurServices';
import Foot from './components/homePage/molecules/footer/Foot';

class BillingPage extends Component {
    constructor(props) {
        super(props)
        this.state = {
            vegetableData: vegetableData,
            cartStatus: CART_STATUS
        }
        this.searchVegetable = searchVegetable.bind(this);
    }

    render() {
        return (
            <>
                <Navbar searchVegetable={this.searchVegetable} cartStatus={this.state.cartStatus} />
                <SubHeaderCategories />
                <OurServices />
                <Foot />
            </>
        )
    }
}

export default BillingPage
